import './App.css';

function App() {
  return (
    <div>
      <h1>가계부</h1>

      <div class="button-group">
      <button type='radio' name="transactionType" value='income'>수입</button>
      <button type='radio' name="transactionType" value='expense'>지출</button>
    </div>

      <div class="input-section">
        <input type="number" id="amount" placeholder="금액 입력" />
        <button id="addTransactionButton">등록</button>
      </div>

      <div>
        총 금액: <span id='total'>0</span> 원
      </div>
    </div>
  );
}

export default App;
